import React from 'react';
import './style.css';

/**
* @author
* @function Logo
**/

const Logo = (props) => {
  return(
    <div className="logo">
      <img src="foldScope-emblem.png" className="App-logo" alt="logo" />
     <a href="#">Fold Scope</a>
    </div>
   )

 }

export default Logo
